Here is the latest and may be last news from her current site, written by the admin.

&quot;This website is closing down around August 19, 2014


I have been doing the site for 13 years and I want to retire. Christina and I have been 50-50 partners and I have sent a truck load of money to Florida.

Christina intends to start another site. Please support her in any future projects. I am giving her about 60 unused sets.

1) Member's re-billing will automatically be cancelled.

2) There will be three movies posted in August.

3) I don't know when Christina's new site will be running.&quot;


All current developements can be followed on Twitter. Go to @christinamodel7 and check. 


